import React from "react";
import "./style.css";
import one from "./blog/one.md";
import Markdown from "react-markdown";

export default class Blog extends React.Component {
  constructor() {
    super();
  }
  render() {
    return (
      <>
        <center>
          <Markdown source={one} />

          <div className="dashboard">Open Source Collage Blog</div>
        </center>
      </>
    );
  }
}
